create table goofish_product
(
    id                   bigint auto_increment
        primary key,
    channel_cat_id       varchar(100) null,
    create_time          datetime(6)  null,
    create_time_remote   bigint       null,
    district_id          int          null,
    express_fee          bigint       null,
    is_selected          bit          null,
    item_biz_type        int          null,
    offline_time         bigint       null,
    online_time          bigint       null,
    original_price       bigint       null,
    outer_id             varchar(100) null,
    price                bigint       null,
    product_id           bigint       not null,
    product_status       int          null,
    sold                 int          null,
    sold_time            bigint       null,
    source               int          null,
    sp_biz_type          int          null,
    spec_type            int          null,
    specify_publish_time bigint       null,
    stock                int          null,
    stuff_status         int          null,
    sync_time            datetime(6)  null,
    title                varchar(500) null,
    update_time          datetime(6)  null,
    media_id             bigint       null comment '关联媒体库ID',
    update_time_remote   bigint       null,
    constraint UK_44d3maw4pb26j47g4b2sc8xny
        unique (product_id)
);

create index idx_media_id
    on goofish_product (media_id);

